import React from 'react';
import '../App.css'

function Work() {
  const spanStyle = {
    fontSize: '30px'
  }
    return (
      <div className="firstHomeDiv">
      <div className="firstHomeDivContent">
        <p className="customP">05. What's next?</p><h1 style={spanStyle}>Get in touch</h1>
        <p>I am open for new challenges, let me bring my knowledge into your company.</p>
        
      </div>
    </div>
    );
  }
  
  export default Work;
